            <div className="card">
               <div className="card-body" id="contactCard">
                  <h1>TN Design & Construction</h1>
                  <p className="fontQ"><FontAwesomeIcon icon="map-marker-alt" /> 11550 Independent Hill Road<br/> Arrington TN 37014</p>
                  {/* <img src="letterT.png" width="100px" className="m-4" /> */}
                  <p className="fontQ"><FontAwesomeIcon icon="phone" />615-487-6869</p>
                  <p className="fontQ"><FontAwesomeIcon icon="envelope" /> mwnealtenn@gmail.com</p>
               </div>
            </div>
         </div>
      )
   }
}

export default ContactCards;
